import java.util.HashMap;
import java.util.Map;

public class MinimumWindowSubstring {
    public String minWindow(String s, String t) {

        if(t.length() > s.length()){
            return "";
        }
        Map<Character, Integer> targetMap = new HashMap<>();
        for(char targetLetter : t.toCharArray()){
            targetMap.put(targetLetter, targetMap.getOrDefault(targetLetter, 0)+1);
        }

        Map<Character, Integer> windowMap = new HashMap<>();

        int i=0, j=0;
        int interval[] = {-1, -1};
        int foundWords = 0;
        char[] source = s.toCharArray();
        while(j<s.length()){
            //traverse with j
            if(!targetMap.containsKey(source[j])){
                j++; continue;
            }
            windowMap.put(source[j], windowMap.getOrDefault(source[j], 0)+1);
            //using primitive comparator, knowing the values can't be null (trivial)
            if(windowMap.get(source[j]) == targetMap.get(source[j])){
                foundWords++;
            }
            j++;  
                
            // traverse with i    
            while(foundWords == targetMap.size()){
                updateIntervalIfSmaller(interval, i, j);
                if(!targetMap.containsKey(source[i])){
                    i++; 
                    continue;
                }
                windowMap.put(source[i], windowMap.get(source[i])-1);
                //using primitive comparator, knowing the values can't be null (trivial)
                if(windowMap.get(source[i]) < targetMap.get(source[i])){
                    foundWords--;
                }
                i++;
            }
        }

        if(interval[0]==-1)
            return "";

        return s.substring(interval[0], interval[1]);
        
    }

    private void updateIntervalIfSmaller(int[] intervalArray, int start, int end){
        //either the new interval is small or no subarray was found earlier
        if((end-start) < (intervalArray[1]-intervalArray[0]) || intervalArray[0] == -1){
            intervalArray[0] = start;
            intervalArray[1] = end;
        }
        
    }
    
    

    public static void main(String[] args) {
        MinimumWindowSubstring minimumWindowSubstring = new MinimumWindowSubstring();
        String s = "";
        String t = "";
        var k = minimumWindowSubstring.minWindow(s, t);
        System.out.println(k);
    }
}
